import ConvertKitForm from "convertkit-react";

const FORM_ID = 1875705;

const config = {
    formId: FORM_ID,
    template: 'clare',
    namePlaceholder: 'Zac Efron',
    emailPlaceholder: 'e.g. zac@efron.com',
    submitText: 'Sign up',
}

const Test = () => (
    <body>
        <h1>hi</h1>
        <ConvertKitForm {...config} />
    </body>
)

export default Test;
